import React, { forwardRef } from "react";
import "../Assets/Css/LandingPage.scss";
import Logo from "../Assets/Img/Logo.jpg";
function Page1() {
  return (
    <div>
        {/* header Page Start */}
      <div className="HeaderPage">
        <img className="LogoEquity" src={Logo} alt="" />
        <h2 className="HeaderTitle">
          <b>From Pengkinian Data</b>
        </h2>
      </div>
        {/* Header Page End */}
        <div className="FromIsi">

            <form>
                {/* nomer Polis */}
                <div className="col nomerPolisWrap">
                    <label htmlFor="noPolis">Nomor Polis <span>*</span></label>
                    <input type="text" id="noPolis" />
                </div>
                {/* Nama Lengkap */}
                <div className="col nameWrap">
                    <label htmlFor="Name">Nama Lengkap  <span>*</span></label>
                    <input type="text" id="Name" />
                </div>
                {/* Nomor Ponsel */}



            </form>
        </div>


    </div>
  );
}

export default Page1;
